    render() {
        console.log("home")
        return (
            <div>
                <div className="">
                <h1>Hello soccer fans.</h1>
                <h2>Stay tuned to your favorite team without hustle.</h2>
                <Link to='/team-select' className="btn teamSelectLink"></Link>
                </div>
            </div>
        )
    }
}
